import React from 'react';
import Card from '../UI/Card';

function FavoritesList (props) {

    return (
        <li>
            <Card>

                <div>
                {props.map((val, key) => {
                    return (

                            <div>
                                <h3>Name: {val.name}</h3> 

                            </div> 
                    )})}
                    </div>
            </Card>
        </li>
    );
}

export default FavoritesList;
